FOR EACH ROW
BEGIN

DECLARE ifTitleExist INT;
DECLARE dateToParse DATE;



SET ifTitleExist = ( SELECT COUNT(*) FROM Tytul WHERE Tytul.ID LIKE NEW.tytul );

