/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER szkola_nieobecnosc_trig BEFORE INSERT ON Nieobecnosc
FOR EACH ROW
BEGIN

DECLARE ifStudentExist INT;



SET ifStudentExist = ( SELECT COUNT(*) FROM Uczen WHERE Uczen.PESEL LIKE NEW.uczen );

IF ( ifStudentExist = 0 ) THEN
SET NEW.uczen = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'wskazany uczen nie istnieje';
END IF;

END */;;
