/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER szkola_test_trig BEFORE INSERT ON Test
FOR EACH ROW
BEGIN

DECLARE ifClassExist INT;
DECLARE ifSubjectExist INT;



SET ifClassExist = ( SELECT COUNT(*) FROM Klasa WHERE Klasa.ID LIKE NEW.klasa );

IF ( ifClassExist = 0 ) THEN
SET NEW.klasa = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'wskazana klasa nie istnieje';
END IF;



SET ifSubjectExist = ( SELECT COUNT(*) FROM Przedmiot WHERE Przedmiot.ID LIKE NEW.przedmiot );

IF ( ifSubjectExist = 0 ) THEN
SET NEW.przedmiot = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'wskazany przedmiot nie istnieje';
END IF;



IF ( CURDATE() < NEW.data_test ) THEN
SET NEW.data_test = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'wskazana data nalezy do przyszlosci';
END IF;

END */;;
