/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER szkola_uczen_trig BEFORE INSERT ON Uczen
FOR EACH ROW
BEGIN

DECLARE thisYear INT;
DECLARE PESELYear INT;
DECLARE thisMonth INT;
DECLARE PESELMonth INT;
DECLARE thisDay INT;
DECLARE PESELDay INT;
DECLARE thisGender INT;
DECLARE PESELGender INT;
DECLARE dateToParse DATE;
DECLARE ifClassExist INT;



SET thisYear = YEAR(NEW.data_urodzenia);
SET PESELYear = SUBSTR(NEW.PESEL, 1, 2);

SET thisMonth = MONTH(NEW.data_urodzenia);
SET PESELMonth = SUBSTR(NEW.PESEL, 3, 2);

SET thisDay = DAY(NEW.data_urodzenia);
SET PESELDay = SUBSTR(NEW.PESEL, 5, 2);

SET thisGender = 1;
SET PESELGender = MOD(SUBSTR(NEW.PESEL, 10, 1), 2);

IF ( NEW.plec LIKE 'K') THEN
SET thisGender = 0;
END IF;

IF ( RIGHT(thisYear, 2) <> PESELYear OR thisMonth <> PESELMonth OR thisDay <> PESELDay OR thisGender <> PESELGender) THEN
SET NEW.PESEL = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'zly format PESEL';
END IF;



SET dateToParse = DATE_SUB(CURDATE(), INTERVAL 14 YEAR);

IF ( dateToParse < NEW.data_urodzenia ) THEN
SET NEW.data_urodzenia = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'uczen musi miec ukonczone 14 lat';
END IF;



SET ifClassExist = ( SELECT COUNT(*) FROM Klasa WHERE Klasa.ID LIKE NEW.klasa );

IF ( ifClassExist = 0 ) THEN
SET NEW.klasa = NULL;
SIGNAL SQLSTATE 'ERROR'
SET MESSAGE_TEXT = 'wskazana klasa nie istnieje';
END IF;

END */;;
DELIMITER ;
