CREATE DEFINER=`root`@`localhost` PROCEDURE `funkcjaNaOcenach`(IN testID INT, IN theFunction VARCHAR(10))
BEGIN

DECLARE EXIT HANDLER FOR SQLSTATE '42000' SELECT 'Blad funkcji' AS Blad;

IF EXISTS(SELECT ID FROM Test WHERE ID = testID) THEN

SET autocommit = 0;
START TRANSACTION;

	IF (theFunction = "avg") THEN

        SET @str = CONCAT("SELECT T.testID1, O.ocena FROM (SELECT test AS testID1, FLOOR(AVG(ocena)) AS oc FROM Ocena WHERE test = ", testID, " GROUP BY test) T JOIN Ocena O ON O.test = T.testID1 WHERE T.oc = O.ocena GROUP BY T.testID1;");
		PREPARE stmt FROM @str;
		EXECUTE stmt;
		DEALLOCATE PREPARE stmt;
        
	ELSE
    
		SET @str = CONCAT("SELECT test AS testID, ", theFunction, "(ocena) AS ", theFunction, " FROM Ocena WHERE test = ", testID, " GROUP BY test;");
		PREPARE stmt FROM @str;
		EXECUTE stmt;
		DEALLOCATE PREPARE stmt;
        
	END IF;
    
COMMIT;
    
ELSE

	SIGNAL SQLSTATE '22222'SET MESSAGE_TEXT = 'Wrong input.', MYSQL_ERRNO = 1000;
    
END IF;

END ;;
