SET tempDate = (DATE_SUB("2002-12-31", INTERVAL randDays DAY));

IF ( MOD(addPESELgender, 2) = 0 ) THEN

INSERT INTO Uczen
VALUES (
(SELECT CONCAT(RIGHT(YEAR(tempDate), 2), LPAD(MONTH(tempDate), 2, '0'), LPAD(DAY(tempDate), 2, '0'), addPESEL1, addPESELgender, addPESEL2)),
(ELT(1 + FLOOR(RAND()*20), 'Zuzanna', 'Julia', 'Zofia', 'Hanna', 'Alicja', 'Natalia', 'Maria', 'Emilia', 'Anna', 'Iga', 'Malgorzata', 'Marta', 'Krystyna', 'Sylwia', 'Anna', 'Weronika', 'Katarzyna', 'Maja', 'Aleksandra', 'Ewa')),
