CREATE DEFINER=`root`@`localhost` PROCEDURE `zwolnienieNauczyciela`(IN teacher INT)
BEGIN

DECLARE countOfSubjects INT;
DECLARE randTeacher INT;
DECLARE randEducator INT;

IF EXISTS(SELECT ID FROM Nauczyciel WHERE ID = teacher) THEN

SET autocommit = 0;
START TRANSACTION;

	SET countOfSubjects = (SELECT COUNT(*) FROM Przedmiot WHERE nauczyciel = teacher);
    SET randTeacher = (SELECT ID FROM Nauczyciel 
									JOIN (SELECT nauczyciel AS teach, COUNT(ID) AS ct FROM Przedmiot GROUP BY nauczyciel ORDER BY ct ASC LIMIT 1) AS A 
									WHERE Nauczyciel.ID = A.teach);
	
	IF (countOfSubjects > 0) THEN
    
		IF (randTeacher = teacher) THEN
		
            SET randTeacher = (SELECT ID FROM Nauczyciel 
											JOIN (SELECT nauczyciel AS teach, COUNT(ID) AS ct FROM Przedmiot GROUP BY nauczyciel ORDER BY ct ASC LIMIT 1, 1) AS A 
											WHERE Nauczyciel.ID = A.teach);
		
        END IF;
    
		UPDATE Przedmiot
        SET nauczyciel = randTeacher
        WHERE nauczyciel = teacher;
    
    END IF;
    
    IF EXISTS(SELECT ID FROM Klasa WHERE wychowawca = teacher) THEN
    
		SET randEducator = (SELECT ID FROM Nauczyciel WHERE ID NOT IN (SELECT wychowawca FROM Klasa) order by RAND() LIMIT 1);
    
		UPDATE Klasa
        SET wychowawca = randEducator
        WHERE wychowawca = teacher;
    
    END IF;
    
    DELETE FROM Nauczyciel WHERE ID = teacher;
    
COMMIT;
    
ELSE

	SIGNAL SQLSTATE '22222'SET MESSAGE_TEXT = 'Wrong input.', MYSQL_ERRNO = 1000;

END IF;

END ;;
